import React from "react";
import logo from "../../assets/images/logo.png";
// import { Button } from "@material-tailwind/react";
const Navbar = () => {
  return (
    <>
      <nav className="flex items-center justify-between px-4 py-3 bg-gradient-to-r from-black to-gray-900">
        {/* Left Icon */}
        <div className="flex items-center">
          <div className="w-10 h-10 bg-gradient-to-r flex items-center justify-center">
            <img className="text-white font-bold" src="logo" alt="logo"/>
          </div>
        </div>

        {/* Right Button */}
        <div>
          <button className="bg-white text-black font-semibold py-2 px-6 rounded-full shadow-md hover:bg-gray-200 transition">
            Join Waitlist
          </button>
        </div>
      </nav>
    </>
  );
};

export default Navbar;
